column8:
VW THE BEETLEのUSBフラッシュメモリーです。<br>
   どれもインテリアとして飾っておきたくなる可愛さです。<br>
  車体のデザインが精密に再現してあります！<br>
  <br>
  容量は8GBです。<br>
  これ1台で画像も映像もたっぷり入ります。<br>
  ジャンル別に色分けするのも良さそう。<br>
  <br>
  サイズ：12.5×6×6cm（パッケージサイズ）<br>
  材質：ダイキャスト、プラスチック<br>
  メモリー容量：8GB<br>
  対応OS：Windows8/Windows7/Vista(～SP2)/XP(～SP3),Mac OS X <br>
  保障期間：1年（データ消失は保証対象外）<br>
  対象：14歳以上<BR>
  品番：652125<BR><style type="text/css">
